syntax = "proto3";

package snapchat.search;

import "snapchat/search/SCS2ServiceDebug_SectionDebug_LiteItemDebug.proto";
import "snapchat/search/SCS2ServiceDebug_SectionDebug_ScoringDebug.proto";

message SCS2ServiceDebug_SectionDebug {
	string sectionName = 1;
	repeated snapchat.search.SCS2ServiceDebug_SectionDebug_LiteItemDebug liteItemDebugArray = 2;
